import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import Order from './Order';

class OrderList extends Component {

  render() {
    return this.props.orders.map((order) => (
      <Order order={order} />
  ));
  }

}


export default withRouter(OrderList);
